-- ----------------------------
-- View structure for vs_views
-- ----------------------------
DROP VIEW IF EXISTS `vs_views`;
CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost`  VIEW `vs_views` AS SELECT `tbl_vehicle_schedule`.`id` AS `id`,`tbl_vehicle_schedule`.`local_price` AS `local_price`,`tbl_vehicle_schedule`.`foreigner_price` AS `foreigner_price`,`tbl_vehicle_schedule`.`travel_duration` AS `travel_duration`,`tbl_vehicle_schedule`.`status` AS `status`,`tbl_vehicle`.`vehicle_name` AS `vehicle_name`,`tbl_origin`.`origin` AS `origin`,`tbl_origin1`.`origin` AS `destination`,`tbl_departure_time`.`departure_time` AS `departure_time1`,`tbl_company`.`company_name` AS `company_name`,`tbl_vehicle`.`company_id` AS `company_id` from (((((`tbl_vehicle_schedule` join `tbl_vehicle` on((`tbl_vehicle_schedule`.`v_id` = `tbl_vehicle`.`id`))) join `tbl_origin` on((`tbl_vehicle_schedule`.`origin` = `tbl_origin`.`id`))) join `tbl_origin` `tbl_origin1` on((`tbl_vehicle_schedule`.`destination` = `tbl_origin1`.`id`))) join `tbl_departure_time` on((`tbl_vehicle_schedule`.`departure_time` = `tbl_departure_time`.`id`))) join `tbl_company` on((`tbl_company`.`id` = `tbl_vehicle`.`company_id`))) ;

-- ----------------------------
-- View structure for v_last_minute_deals
-- ----------------------------
DROP VIEW IF EXISTS `v_last_minute_deals`;
CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost`  VIEW `v_last_minute_deals` AS SELECT 
distinct  d.dest_id,d.destinations,d.dest_landmark,d.country
,h.hotel_id,h.h_name,h.h_slug,h.h_feature_image,h.h_description,h.h_address,h.star_rating,
hr.hroom_id,hr.hr_name,hr.hr_image,hr.hr_max,min(hr.hr_base_rate)
FROM destinations as d LEFT JOIN hotels as h on h.dest_id=d.dest_id
INNER JOIN hotel_rooms as hr ON h.hotel_id=hr.hotel_id ;

-- ----------------------------
-- View structure for v_list_hotels
-- ----------------------------
DROP VIEW IF EXISTS `v_list_hotels`;
CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost`  VIEW `v_list_hotels` AS SELECT h.*,dest.destinations,
hr.amenities,hr.hr_base_rate as rate
FROM hotels as h INNER JOIN destinations as dest ON dest.dest_id=h.dest_id 
INNER JOIN hotel_rooms as hr ON h.hotel_id=hr.hotel_id 
WHERE h.hotel_blocked='N' 
GROUP BY h.hotel_id ;

-- ----------------------------
-- View structure for v_ticket
-- ----------------------------
DROP VIEW IF EXISTS `v_ticket`;
CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost`  VIEW `v_ticket` AS SELECT tk.booking_code,tk.booking_date,tk.title,tk.passenger_name as name,tk.seat_number,tk.u_id

FROM tbl_ticket as tk ;
